          <div className="form-group">
            <label htmlfor="mothernation">လူမျိုး/ကိုးကွယ်သည့်ဘာသာ</label>
            <input
              onChange={handleMotherNationChange}
              id="mothernation"
              value={mothernation}
              type="text"
              name="mothernation"
              required
            />
