          <br />
          <h2>ဖွင့်လှစ်မည့်သင်တန်းများ</h2>
          <br />

          <div class="courses">
            <div>
              <ol>
                <li>Civil(မြို့ပြသင်တန်း)</li>
                <li>Electronics(အီလက်ထရောနစ်)</li>
                <li>Electrical Power(လျှပ်စစ်စွမ်းအား)</li>
                <li>Mechanical(စက်မှုစွမ်းအား)</li>
                <li>Information Technology(သုတနည်းပညာ)</li>
              </ol>
