            <br />
            <h2>
              တက်‌ရောက်လိုသောသင်တန်း(ကွက်လက်အားလုံးပြည့်စုံစွာဖြည့်စွက်ပါရန်)
            </h2>
            <br />
            <div>
              <ul>
                <li>
                  ပထမဦးစားပေး{" "}
                  <select
                    value={selectedValue}
                    onChange={onOptionChangeHandler1}
                  >
                    {options.map((option, index) => {
                      return <option key={index}>{option}</option>;
                    })}
                  </select>
                </li>
                <br />
                <li>
                  ဒုတိယဦးစားပေး{" "}
                  <select
                    value={selectedValue2}
                    onChange={onOptionChangeHandler2}
                  >
                    {options.map((option, index) => {
                      return <option key={index}>{option}</option>;
                    })}
                  </select>
                </li>
                <br />
                <li>
                  တတိယဦးစားပေး{" "}
                  <select
                    value={selectedValue3}
                    onChange={onOptionChangeHandler3}
                  >
                    {options.map((option, index) => {
                      return <option key={index}>{option}</option>;
                    })}
                  </select>
                </li>
                <br />
                <li>
                  စတုတ္ထဦးစားပေး{" "}
                  <select
                    value={selectedValue4}
                    onChange={onOptionChangeHandler4}
                  >
                    {options.map((option, index) => {
                      return <option key={index}>{option}</option>;
                    })}
                  </select>
                </li>
                <br />
                <li>
                  ပဥ္စမဦးစားပေး{" "}
                  <select
                    value={selectedValue5}
                    onChange={onOptionChangeHandler5}
                  >
                    {options.map((option, index) => {
                      return <option key={index}>{option}</option>;
                    })}
                  </select>
                </li>
              </ul>
            </div>
          </div>
          <br />

          <div class="submit">
            <button type="submit" required>
              Submit
            </button>
          </div>

          <div className=" back">
            <Link to="/chooseyear">
              <button>Back</button>
            </Link>
          </div>

          <div class="next">
            {" "}
            <Link to="/agreeform">
              <button>Next</button>
            </Link>{" "}
          </div>
        </div>
      </div>
    </form>
  );
